void await_vsync() {

    volatile int* ptr = (int*)0xff203020;
    register int status;

    *ptr = 1;
    status = *(ptr + 3);

    while ((status & 0x01) != 0) {

        status = *(ptr + 3);

    }

}

void cls() {

    int i = 0, j = 0;

    for (int k = 0; k < 320 * 2 * 240 - 1; k += 2) {

        int red = ((data_bg[k + 1] & 0xF8) >> 3) << 11;
        int green = (((data_bg[k] & 0xE0) >> 5)) | ((data_bg[k + 1] & 0x7) << 3);
        int blue = (data_bg[k] & 0x1f);

        short int p = red | ((green << 5) | blue);

        plot_pixel(i, j, p);

        i += 1;
        if (i == 320) {
            i = 0;
            j += 1;
        }
        
    }

    i = rasenganPos[currRasengan].x;
    j = rasenganPos[currRasengan].y;
    // i = rasenganPos[currRasengan].x - WIDTH_NARUTO/2;
    // j = rasenganPos[currRasengan].y - HEIGHT_NARUTO/2;

    for (int k = 0; k < WIDTH_NARUTO * 2 * HEIGHT_NARUTO - 1; k += 2) {

        int red = ((data_naruto[k + 1] & 0xF8) >> 3) << 11;
        int green = (((data_naruto[k] & 0xE0) >> 5)) | ((data_naruto[k + 1] & 0x7) << 3);
        int blue = (data_naruto[k] & 0x1f);

        short int p = red | ((green << 5) | blue);

        plot_pixel(i, j, p);

        i += 1;
        
        if (i == rasenganPos[currRasengan].x + WIDTH_NARUTO) {
            i = rasenganPos[currRasengan].x;
            j += 1;
        }

    }


    i = sasukePos.x;
    j = sasukePos.y;
    // i = sasukePos.x - WIDTH_SASUKE/2;
    // j = sasukePos.y - HEIGHT_SASUKE/2;

    for (int k = 0; k < WIDTH_SASUKE * 2 * HEIGHT_SASUKE - 1; k += 2) {

        int red = ((data_sasuke[k + 1] & 0xF8) >> 3) << 11;
        int green = (((data_sasuke[k] & 0xE0) >> 5)) | ((data_sasuke[k + 1] & 0x7) << 3);
        int blue = (data_sasuke[k] & 0x1f);

        short int p = red | ((green << 5) | blue);

        plot_pixel(i, j, p);

        i += 1;
        
        if (i == sasukePos.x + WIDTH_SASUKE) {
            i = sasukePos.x;
            j += 1;
        }

    }



}

void swap_buffers() {
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer	
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int*)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

//swap two variables
inline void swap(int* a, int* b) {

    int temp = *a;
    *a = *b;
    *b = temp;

}